import React from 'react';
import { Link, withRouter } from 'react-router-dom';
//import '../../App.css';

class TypeAhead extends React.Component {

        constructor(props) {
            super(props);
            this.state = {
                navigation: "standard",
            };
            this.topNav = React.createRef();
        }
        componentDidMount() {
            console.log("foot locker")
        }

        getSearch = () => {
            let inp = document.getElementById(this.props.object);
            console.log("search for " + inp.value);
        }

        render() {
                if (this.props.location.pathname === '/login') return null;
                return ( 
                <div className="typeAheadContainer">
                    <input id={this.props.object} onChange={this.getSearch} type="text" />}
                </div>
      );
    }
  }

  export default withRouter(TypeAhead);
